import React, { useState, useEffect } from "react";
import "../../css/EventCard2.css";
import { AvatarImage } from "../commonElements";

const EventCard2Form = ({ onSubmit, eventId,
    width,
    height,
    fontSize,
    eventName,
    eventDate,
    eventTime,
    location,
    city,
    postalCode,
    description,
    category,
    image,
    imageFile,
    user: { firstName, lastName },
    tags,
    backgroundImage,
}) => {
    const [formData, setFormData] = useState({
        eventId,
        eventName,
        eventDate,
        eventTime,
        location,
        city,
        postalCode,
        description,
        category,
        image,
        imageFile,
        tags,
        backgroundImage,
    });

    useEffect(() => {
        setFormData({
            eventId,
            eventName,
            eventDate,
            eventTime,
            location,
            city,
            postalCode,
            description,
            category,
            image,
            imageFile,
            tags,
            backgroundImage,
        });
    }, [eventId,eventName, eventDate, eventTime, location, city, postalCode, description, category, image, imageFile, tags, backgroundImage]);

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (typeof onSubmit === "function") {
        onSubmit(formData);
        } 
        else {
            console.error("onSubmit is not a function");
        }
    };


    return (
        <form onSubmit={handleSubmit} className="event-card-form">
            <article className="event-card" style={{
                width: width + "px",
                height: height + "px",
                fontSize: fontSize + "px",
                backgroundImage: `linear-gradient(to top, rgba(0,0,0,1), rgba(0,0,0,.1)), url(${
                    formData.backgroundImage ? formData.backgroundImage : formData.image
                })`,
                backgroundRepeat: "no-repeat",
                backgroundPosition: "center center",
                backgroundSize: "cover",
            }}>
                <img src={AvatarImage} alt="avatarImage" className="event-avatar" />
                <p className="match-tag">Match</p>
                <div className="card-content">
                    <label>
                        Event Name:
                        <input type="text" name="eventName" value={formData.eventName} onChange={handleChange} className="card-title" />
                    </label>
                    <p>Host: {`${firstName} ${lastName}`}</p>
                    <label>
                        Category:
                        <input type="text" name="category" value={formData.category} onChange={handleChange} className="category" />
                    </label>
                    <label>
                        Date:
                        <input type="date" name="eventDate" value={formData.eventDate} onChange={handleChange} />
                    </label>
                    <label>
                        Time:
                        <input type="time" name="eventTime" value={formData.eventTime} onChange={handleChange} />
                    </label>
                    <label>
                        Location:
                        <input type="text" name="location" value={formData.location} onChange={handleChange} />
                    </label>
                    <label>
                        City:
                        <input type="text" name="city" value={formData.city} onChange={handleChange} />
                    </label>
                    <label>
                        Postal Code:
                        <input type="text" name="postalCode" value={formData.postalCode} onChange={handleChange} />
                    </label>
                    <label>
                        Description:
                        <textarea name="description" value={formData.description} onChange={handleChange} className="event-details-text" />
                    </label>
                    {/* ... add other input fields similarly ... */}
                    <button type="submit">Update Event</button>
                </div>
            </article>
        </form>
    );
};

export default EventCard2Form;
